import TrackDisplay from "./TrackDisplay"

const RecommendedTracks = ({ trackNames, trackAlbums, trackArtists, trackAlbumCoverUrls }) => {

  const names = []
  
  const albums = []
  trackAlbums.map((album, i) => albums[i] = album)
  const artists = []
  trackArtists.map((artists, i) => artists[i] = artists)
  const urls = []
  trackAlbumCoverUrls.map((url, i) => urls[i] = url)

  return (
    <div style={{marginLeft: 10}}>
      {trackNames.map((name, i) => names[i] = name)}
      <h1>And here they are:</h1>
      <TrackDisplay 
        trackName={names[0]} 
        trackAlbumCoverUrl={albums[0]} 
        trackAlbum={artists[0]} 
        trackArtists={urls[0]} 
      />
      <TrackDisplay 
        trackName={names[1]} 
        trackAlbumCoverUrl={albums[1]} 
        trackAlbum={artists[1]} 
        trackArtists={urls[1]} 
      />
      <TrackDisplay 
        trackName={names[2]} 
        trackAlbumCoverUrl={albums[2]} 
        trackAlbum={artists[2]} 
        trackArtists={urls[2]} 
      />
    </div>
  )
}

export default RecommendedTracks
